  true,\n\t\"url\": null,\n\t\"notes\": \"The Cessna Citation II Research aircraft
  owned and operated by the University of North Dakota (UND) participated in the Midlatitude
  Continental Convective Clouds Experiment (MC3E) supplying navigation data and also
  carrying cloud microphysics instruments.  This navigation dataset consists of final
  processed files containing records with flight time (UT seconds from midnight) and
  aircraft latitude, longitude and altitude, and also contains the IWG1 data collected
  during the mission.  The Flight Summaries and Flight Track Imagery dataset which
  includes sonde maps, radar animation, 5-minute KICT track snapshots is distributed
  with this dataset.\",\n\t\"owner_org\": \"d8a6202b-c0c3-463d-88a0-3bc021a178ed\",\n\t\"extras\":
